import './Navbar.css';

const Navbar = () => {
    return(
        <div className="Navbar">
            <div className="Item">-Профиль</div>
            <div className="Item">-Диалоги</div>
            <div className="Item">-Мои посты</div>
            <div className="Item">-Сохраненное</div>
            <div className="Item">-Друзья</div>
            <div className="Item">-Настройки</div>
        </div>
    );
}

export default Navbar;
